import React, { useState } from "react";
import {
  AppBar,
  Typography,
  Card,
  Paper,
  CardContent,
  TextField,
  Button,
  CardHeader,
  Container,
  FormControl,
  InputLabel,
  Input,
  FormHelperText,
} from "@material-ui/core";
import data from "../MOCK_DATA";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles((theme) => ({
  root: {
    position: "relative",
    marginTop: theme.spacing(2),
    padding: `${theme.spacing(2)}px ${theme.spacing(1)}px`,
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    background:
      "radial-gradient(circle, rgba(6,103,144,1) 21%, rgba(174,45,181,1) 98%)",
    height: 500,
    width: 500,
  },
  inputs:{
    fontFamily: "Cutive Mono, monospace",
    color: "#0D0D0D",
    fontSize: "14px",
    padding: `${theme.spacing(1.5)}px ${theme.spacing(1)}px`,
    borderRadius: "8px",
    border: "1.4px solid",
    boxShadow: "1px 2px 20px rgba(169,198,217,0.29457423) ",
    borderColor: "rgba(206,212,218, .993)",
  }
}));
function Login() {
  const classes = useStyles();
  return (
    <Paper elevation={24} className={classes.root}>
      <form>
      <FormControl fullWidth>
        <InputLabel htmlFor="my-input">Email address</InputLabel>
        <Input id="my-input" aria-describedby="my-helper-text" className = {classes.inputs} />
        <FormHelperText id="my-helper-text">
          We'll never share your email.
        </FormHelperText>
      </FormControl>
      </form>

    </Paper>
  );
}

export default Login;
